aWLI_GenericBenefit.TextualDescription:
{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil MS Sans Serif;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\cf1\f0\fs16 This rider provides a full payout of 50% of the basic death benefit under the Base Policy only for the primary insured, if the insured is certified as terminally ill with no more than 12 months remaining to live. An accelerated benefit payment is subject to an administrative fee: $200. The amount of any benefit payable under this Rider will be paid in a single sum. \par
\par
The payment of an accelerated death benefit under this Rider will reduce the death benefit payable thereafter under the Base Policy. The accelerated death benefits payable under this Rider may be taxable under State or Federal law. You should contact your tax advisor for specific advice. \par
}

